// DSP Pipeline for Proofs
title DSP Pipeline for Proofs

// Nodes and groups
Start [shape: oval, color: lightblue]

Draft stage [color: lightgreen] {
  Draft proof [shape: rectangle]
  Check draft quality [shape: diamond, color: lightcoral]
}

Sketch stage [color: orange] {
  Extract skeleton [shape: rectangle]
  Check skeleton completeness [shape: diamond, color: lightcoral]
}

Proof stage [color: yellow] {
  Fill in details [shape: rectangle]
  Check detail correctness [shape: diamond, color: lightcoral]
}

Verification stage [color: lightcyan] {
  Verify proof [shape: rectangle]
  Check verification result [shape: diamond, color: lightcoral]
}

Feedback stage [color: pink] {
  Generate feedback [shape: rectangle]
}

End [shape: oval, color: lightgray]

// Relationships
Start > Draft proof
Check draft quality > Extract skeleton: satisfactory
Check draft quality > Draft proof: revise draft
Check skeleton completeness > Fill in details: structure adequate
Check skeleton completeness > Extract skeleton: refine structure
Check detail correctness > Verify proof: details valid
Check detail correctness > Fill in details: refine details
Verify proof > Check verification result
Check verification result > End: verification succeeded
Check verification result > Generate feedback: verification failed
Draft proof < Generate feedback: apply feedback
